import React from 'react';
import { List, Card } from 'antd';

const Content01 = () => {
    const data = [
        {
          title: 'Title 1',
        },
        {
          title: 'Title 2',
        },
        {
          title: 'Title 3',
        },
        {
          title: 'Title 4',
        },
        {
          title: 'Title 5',
        },
        {
          title: 'Title 6',
        },
      ];
          
    return (
        <>
        <div style={{ width: '100%', alignItems: 'flex-end'}}>
        <h1> 쉽고 빠른 대출상품</h1>
        </div>
        <List
            grid={{
            gutter: 16,
            column: 2,
            xs: 1,
            sm: 2,
            md: 4,
            lg: 4,
            xl: 6,
            xxl: 3,
            }}
            dataSource={data}
            renderItem={item => (
            <List.Item>
                <Card title={item.title}>Card content</Card>
            </List.Item>
        )}
        />,
        </>
    )
}

export default Content01;
